import React from 'react';

export default class Incarceration extends React.Component{
    render(){
        return(
            <div>
                <form>
                    <label>
                        Nom:
                        <input type="text" id="lastname" name="fname" placeholder="Ex: Dupont"></input>
                    </label>
                    <br/>  
                    <label>
                        Prenom:
                        <input type="text" id="firstname" name="lname" placeholder="Ex: Marcel"></input>
                    </label>
                    <br/>
                    <button value="Ajouter" onClick={() => console.log('ajouter')}>Ajouter</button>
                </form>
            </div>
        );
    }
}
